SELECT
    channel,
    campaign,
    source,
    medium,
    COUNT(*) AS number_of_sessions
FROM
    {{ ref('snowplow_fractribution_sessions_by_customer_id') }}
GROUP BY channel, campaign, source, medium
ORDER BY channel, number_of_sessions DESC

{{
  config(
    sql_header=snowplow_utils.set_query_tag(var('snowplow__query_tag', 'snowplow_dbt'))
  )
}}

SELECT
    CASE
        WHEN page_views.user_id IS NOT NULL AND page_views.user_id != '' THEN 'u' || page_views.user_id -- use event user_id
        {% if var('use_snowplow_web_user_mapping_table') %}
            WHEN user_mapping.domain_userid IS NOT NULL THEN 'u' || user_mapping.user_id
        {% endif %}
        ELSE 'f' || page_views.domain_userid
    END AS customerId, -- f (anonymous) or u (identifier) prefixed user identifier
    derived_tstamp AS visitStartTimestamp, -- we consider the event timestamp to be the session start, rather than the session start timestamp
    {{ channel_classification() }} AS channel,
    refr_urlpath AS referralPath,
    mkt_campaign AS campaign,
    mkt_source AS source,
    mkt_medium AS medium
FROM
    {{ var('page_views_source') }}  page_views
    {% if var('use_snowplow_web_user_mapping_table') %}
        LEFT JOIN
        {{ var('snowplow_web_user_mapping_table') }} AS user_mapping
        ON
        page_views.domain_userid = user_mapping.domain_userid
    {% endif %}
WHERE
    DATE(derived_tstamp) >= DATEADD(d, -{{ var('path_lookback_days') + 1 }},
                                CASE WHEN '{{ var('conversion_window_start_date') }}' = ''
                                THEN current_date()-31
                                ELSE '{{ var('conversion_window_start_date') }}'
                                END)
    AND
    DATE(derived_tstamp) <= CASE WHEN '{{ var('conversion_window_end_date') }}' = ''
                                THEN current_date()-1
                                ELSE '{{ var('conversion_window_end_date') }}'
                                END
    AND
    -- restrict to certain hostnames
    {% if var('conversion_hosts') == '' or var('conversion_hosts') == None %}
      {{ exceptions.raise_compiler_error("Error: var('conversion_host') needs to be set!") }}

    {% endif %}
    page_urlhost IN (
        {%- for urlhost in var('conversion_hosts') %}
            '{{ urlhost }}'
            {%- if not loop.last %},{% endif %}
        {%- endfor %}
    )

    {% if var('consider_intrasession_channels') %}
        -- yields one row per channel change
        AND mkt_medium IS NOT NULL AND mkt_medium != ''
    {% else %}
        -- yields one row per session (last touch)
        AND page_view_in_session_index = 1 -- takes the first page view in the session
    {% endif %}

{{ 
  config(
    sql_header=snowplow_utils.set_query_tag(var('snowplow__query_tag', 'snowplow_dbt'))
  ) 
}}

-- Requires TrimLongPath UDF

WITH Conversions AS (
  SELECT DISTINCT customerId
  FROM {{ ref('snowplow_fractribution_conversions_by_customer_id') }}
),
NonConversions AS (
  SELECT
    customerId,
    MAX(visitStartTimestamp) AS nonConversionTimestamp
  FROM {{ ref('snowplow_fractribution_sessions_by_customer_id') }} se
  LEFT JOIN Conversions
    USING (customerId)
  WHERE Conversions.customerId IS NULL
  GROUP BY customerId
)
SELECT
  NonConversions.customerId,
  ARRAY_TO_STRING({{schema}}.TrimLongPath(
    ARRAY_AGG(channel) WITHIN GROUP (ORDER BY visitStartTimestamp), {{ var('path_lookback_steps') }}), ' > ') AS path,
  ARRAY_TO_STRING(
    {% for path_transform_name, _ in var('path_transforms')|reverse %}
      {{schema}}.{{path_transform_name}}(
    {% endfor %}
        ARRAY_AGG(channel) WITHIN GROUP (ORDER BY visitStartTimestamp)
    {% for _, arg_str in var('path_transforms') %}
      {% if arg_str %}, {{arg_str}}{% endif %})
    {% endfor %}
    , ' > ') AS transformedPath
FROM NonConversions
LEFT JOIN {{ ref('snowplow_fractribution_sessions_by_customer_id') }} se
  ON
    NonConversions.customerId = se.customerId
    AND DATEDIFF(day, visitStartTimestamp, nonConversionTimestamp)
      BETWEEN 0 AND {{ var('path_lookback_days') }}
GROUP BY NonConversions.customerId

macro.snowplow_fractribution.snowflake__.macro_sql:
{% macro snowflake__create_udfs() %}

{{ config(
  schema="derived"
)}}
  {% set trim_long_path %}
  -- Returns the last path_lookback_steps channels in the path if path_lookback_steps > 0,
  -- or the full path otherwise.
  CREATE FUNCTION IF NOT EXISTS {{schema}}.TrimLongPath(path ARRAY, path_lookback_steps DOUBLE)
  RETURNS ARRAY LANGUAGE JAVASCRIPT AS $$
  if (PATH_LOOKBACK_STEPS > 0) {
      return PATH.slice(Math.max(0, PATH.length - PATH_LOOKBACK_STEPS));
    }
    return PATH;
  $$;
  {% endset %}


  -- Functions for applying transformations to path arrays.
  -- uniquePath: Identity transform.
  --   E.g. [D, A, B, B, C, D, C, C] --> [D, A, B, B, C, D, C, C].
  -- exposure: Collapse sequential repeats.
  --   E.g. [D, A, B, B, C, D, C, C] --> [D, A, B, C, D, C].
  -- first: Removes repeated events.
  --   E.g. [D, A, B, B, C, D, C, C] --> [D, A, B, C].
  -- frequency: Removes repeat events but tracks them with a count.
  --   E.g. [D, A, B, B, C, D, C, C] --> [D(2), A(1), B(2), C(3)).


  {% set remove_if_not_all %}
  -- Returns the path with all copies of targetElem removed, unless the path consists only of
  -- targetElems, in which case the original path is returned.
  CREATE FUNCTION IF NOT EXISTS {{schema}}.RemoveIfNotAll(path ARRAY, targetElem STRING)
  RETURNS ARRAY
  LANGUAGE JAVASCRIPT AS $$
    var transformedPath = [];
    for (var i = 0; i < PATH.length; i++) {
      if (PATH[i] !== TARGETELEM) {
        transformedPath.push(PATH[i]);
      }
    }
    if (!transformedPath.length) {
      return PATH;
    }
    return transformedPath;
  $$;
  {% endset %}

  {% set remove_if_last_and_not_all %}
  -- Returns the path with all copies of targetElem removed from the tail, unless the path consists
  -- only of targetElems, in which case the original path is returned.
  CREATE FUNCTION IF NOT EXISTS {{schema}}.RemoveIfLastAndNotAll(path ARRAY, targetElem STRING)
  RETURNS ARRAY
  LANGUAGE JAVASCRIPT AS $$
    var tailIndex = PATH.length;
    for (var i = PATH.length - 1; i >= 0; i = i - 1) {
      if (PATH[i] != TARGETELEM) {
        break;
      }
      tailIndex = i;
    }
    if (tailIndex > 0) {
      return PATH.slice(0, tailIndex);
    }
    return PATH;
  $$;
  {% endset %}

  {% set unique %}
  -- Returns the unique/identity transform of the given path array.
  -- E.g. [D, A, B, B, C, D, C, C] --> [D, A, B, B, C, D, C, C].
  CREATE FUNCTION IF NOT EXISTS {{schema}}.UniquePath(path ARRAY)
  RETURNS ARRAY
  LANGUAGE JAVASCRIPT AS $$
    return PATH;
  $$;
  {% endset %}

  {% set exposure %}
  -- Returns the exposure transform of the given path array.
  -- Sequential duplicates are collapsed.
  -- E.g. [D, A, B, B, C, D, C, C] --> [D, A, B, C, D, C].
  CREATE FUNCTION IF NOT EXISTS {{schema}}.Exposure(path ARRAY)
  RETURNS ARRAY
  LANGUAGE JAVASCRIPT AS $$
    var transformedPath = [];
    for (var i = 0; i < PATH.length; i++) {
      if (i == 0 || PATH[i] != PATH[i-1]) {
        transformedPath.push(PATH[i]);
      }
    }
    return transformedPath;
  $$;
  {% endset %}

  {% set first %}
  -- Returns the first transform of the given path array.
  -- Repeated channels are removed.
  -- E.g. [D, A, B, B, C, D, C, C] --> [D, A, B, C].
  CREATE FUNCTION IF NOT EXISTS {{schema}}.First(path ARRAY)
  RETURNS ARRAY
  LANGUAGE JAVASCRIPT AS $$
    var transformedPath = [];
    var channelSet = new Set();
    for (const channel of PATH) {
      if (!channelSet.has(channel)) {
        transformedPath.push(channel);
        channelSet.add(channel)
      }
    }
    return transformedPath;
  $$;
  {% endset %}

  {% set frequency %}
  -- Returns the frequency transform of the given path array.
  -- Repeat events are removed, but tracked with a count.
  -- E.g. [D, A, B, B, C, D, C, C] --> [D(2), A(1), B(2), C(3)].
  CREATE FUNCTION IF NOT EXISTS {{schema}}.Frequency(path ARRAY)
  RETURNS ARRAY
  LANGUAGE JAVASCRIPT AS $$
    var channelToCount = {};
    for (const channel of PATH) {
      if (!(channel in channelToCount)) {
        channelToCount[channel] = 1
      } else {
        channelToCount[channel] +=1
      }
    }
    var transformedPath = [];
    for (const channel of PATH) {
      count = channelToCount[channel];
      if (count > 0) {
        transformedPath.push(channel + '(' + count.toString() + ')');
        // Reset count to 0, since the output has exactly one copy of each event.
        channelToCount[channel] = 0;
      }
    }
    return transformedPath;
  $$;
  {% endset %}


  -- create the udfs (as permanent UDFs)
  create schema if not exists {{schema}};
  {% do run_query(trim_long_path) %}
  {% do run_query(remove_if_not_all) %}
  {% do run_query(remove_if_last_and_not_all) %}
  {% do run_query(unique) %}
  {% do run_query(exposure) %}
  {% do run_query(first) %}
  {% do run_query(frequency) %}

{% endmacro %}

